import React from "react";
import { ScrollView, Text, StyleSheet } from "react-native";
import { DataTable } from "react-native-paper";

const ScoreBoardScreen = () => {
  return (
    <ScrollView>
      <DataTable>
        <DataTable.Header style={styles.dataTable}>
          <DataTable.Title numeric>
            <Text style={styles.title}>Vivian</Text>
          </DataTable.Title>
          <DataTable.Title numeric>Fl√°vio</DataTable.Title>
          <DataTable.Title numeric>Sarita</DataTable.Title>
          <DataTable.Title numeric>Debora</DataTable.Title>
        </DataTable.Header>
      </DataTable>
    </ScrollView>
  );
};

const styles = StyleSheet.create({
  dataTable: {
    backgroundColor: "pink",
    flex: 1
  },
  title: {
    textAlign: "center",
    flex: 1
  }
});

export default ScoreBoardScreen;
